import React from 'react'
import ReactStars from "react-rating-stars-component";

const RatePost = () => {
  return (
    <div>
        <div>
            <h5>Mahmoud Toma</h5>
            <ReactStars {...ReactStars} />
        </div>
    </div>
  )
}

export default RatePost
